import React, { useEffect, useState } from 'react';
import { BrowserRouter as Router, Routes, Route, useLocation, Navigate } from 'react-router-dom';
import './App.css';
import AuthPage from './components/auth/AuthPage';
import Main from './components/Main';
import ImageUploadCard from './components/card/ImageUploadCard';
import Quiz from './components/quiz/Quiz';
import Profile from './components/pages/Profile';
import DailyQuest from './components/pages/DailyQuest';
import BottomNavBar from './components/mobile/BottomNavBar';
import { jwtDecode } from 'jwt-decode';
import Sidebar from './components/main/Sidebar'; // 경로를 정확히 맞춰주세요.

const App = () => {
  const [userList, setUserList] = useState([]);
  const [isAuthenticated, setIsAuthenticated] = useState(false);

  useEffect(() => {
    const token = localStorage.getItem('token');
    if (token) {
      try {
        const decoded = jwtDecode(token);
        // Decoded에서 expiration 시간을 체크하여 만료 여부 판단
        if (decoded.exp * 1000 > Date.now()) {
          setIsAuthenticated(true);
        } else {
          setIsAuthenticated(false);
        }
      } catch (error) {
        console.error('토큰 디코딩 실패:', error);
        setIsAuthenticated(false);
      }
    } else {
      setIsAuthenticated(false);
    }
  }, []);

  const location = useLocation();

  return (
    <div className="App">
      <Routes>
      <Sidebar setIsAuthenticated={setIsAuthenticated} />
      <Route path="/" element={<AuthPage setIsAuthenticated={setIsAuthenticated} />} />
        <Route path="/main" element={isAuthenticated ? <Main /> : <Navigate to="/" />} />
        <Route path="/signup" element={<AuthPage userList={userList} setUserList={setUserList} />} />
        <Route path="/profile" element={isAuthenticated ? <Profile /> : <Navigate to="/" />} />
        <Route path="/quest" element={isAuthenticated ? <DailyQuest /> : <Navigate to="/" />} />
        <Route path="/imageupload" element={isAuthenticated ? <ImageUploadCard /> : <Navigate to="/" />} />
        <Route path="/quiz" element={isAuthenticated ? <Quiz /> : <Navigate to="/" />} />
        {/* 여기에 메인 레이아웃 추가 */}
      </Routes>
      {isAuthenticated && <BottomNavBar />}
    </div>
  );
}

const RootApp = () => (
  <Router>
    <App />
  </Router>
);

export default RootApp;



